webpackJsonp([0xe29e049f27c9],{420:function(e,i){e.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Это упражнение для тренировки широчайших мышц спины и заднего пучка дельтовидных мышц. Основное преимущество упражнения в том, что грудь упирается в скамью, тем самым снимая нагрузку с поясницы.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n<li>Встаньте прямо, возьмите штангу хватом снизу. Исходное положение: руки на ширине плеч, локти близко к туловищу.</li>\n<li>На выдохе - удерживая неподвижно верхние отделы рук (от локтя до плеча) выполните сгибание рук в локтях усилием бицепсов. Работают только предплечья.</li>\n<li>Сгибание должно продолжаться до момента, когда штанга не будет находится на уровне плеч. В верхней точке стоит задержаться, напрягая при этом бицепс.</li>\n<li>На вдохе – медленно опустите штангу в исходное положение.</li>\n<li>Сделайте необходимое количество повторений.</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/APGw5Xi8xfQ" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/podjem-shtangi-na-biceps-stoya",efficiency:"9",title:"Подъем штанги на бицепс стоя",image:"/static/3-00-0.jpg",image_2:"/static/3-00-1.png",image_3:"/static/3-00-2.png",image_4:"",filterby:"biceps",date:"April 12, 2017",injury:"4",bodypart:"Бицепс",filtertype:"isolated",type:"Изолирующее",filterinventory:"stange",inventory:"Штанга",filterplace:null}}},pathContext:{}}}});
